import React from "react";
import {StatefulList} from "baseui/dnd-list";

const MyStatefulList = () => (
    <StatefulList
      initialState={{
        items: ["Item 1", "Item 2", "Item 3"],
      }}
      overrides={{
        Label: {

            style: ({ $theme }) => ({
                color: $theme.colors.negative600,
              }),
          props: {
            "data-testid": "dnd-list-label",
          },
        },
      }}
    />
  );

  export default MyStatefulList;
